import React, { useEffect, useState } from 'react';

const RecipeWiki = () => {
    useEffect(() => {
        async function getRecipe(){
            const res = await fetch('/api/date');
            const recipe = await res.json();
        }
    }, []);
    
    return (
        <div>
            <h1>{recipe}</h1>
        </div>
    );
}
export default RecipeWiki;
